MY LIFE MY STORY- I normally have alot to say but this time I let the music speakthis took me years to release.

Thankyou to everyone involved.
You are truly appreciated. 

@aka FEUGO FELIX on the production of beats, mixing & mastering & engineering.
@RENZ4TP on co-production.

@Miriamdemir on the Epic Artwork

"Sensitive" is the soulful, heart-opening R&B ballad you didn't think you needed. Its breathtaking harmonies, paried with smooth guitar riffs, tender piano lines and a killer beat will make you bop your head AND shed tears, inspiring you to connect with your emotions. Drawing inspiration from my own journey, this song celebrates the power of vulnerability and self-acceptance. I hope its message of embracing sensitivity as a superpower will resonate with listeners,, reminding them that it's okay to feel deeply. 

